  <script>
    var containsDuplicate = function(nums) {
      let len = nums.length;
      for (let i = 0; i < len; i ++) {
        for (let j = i + 1; j < len; j ++) {
          if (nums[i] == nums[j]) {
            console.log(nums[i])
          }
        }
      }
    }
    containsDuplicate([5,2,3,4,15,1,3])
  </script>
